
# Move the first letter of each word to the end of the word.
# Add "ay" to the end of the word.
# Words starting with a vowel (A, E, I, O, U) simply have "WAY" appended to the end.

import clipboard
from string import punctuation
import random

with open("/Users/111244rfsf/Documents/Repositories/theEdabitProject/theEdabitProjectRepo/Python/7AQgJookgCdbom2Zd/words.txt", 'r') as f:
    words = f.readlines()
    words = list(map(lambda x: x.strip("\n"), words))

def random_word_generator(length):
    
    sentence = ""
    for i in range(length):
        sentence += random.choice(words) + " "
    return (sentence.strip() + ".").capitalize()

def pig(word):
    if word[0].lower() in "aeiou":
        return word.lower() + "way"
    return (word[1:] + word[0] + "ay").lower()

def pig_latin(txt):
	txt = txt.lower()
	return (' '.join([i+'way' if i[0] in 'aeiou' else i[1:]+i[0]+'ay' for i in txt[:-1].split()]) + txt[-1]).capitalize()

class Test:
    def assert_equals(a, b):
        try:
            assert a == b
        except AssertionError:
            print(f"{a}\n > should equal \n\t{b}")

def gen_test():
    random_sentence = random_word_generator(5)
    test = f"""Test.assert_equals(pig_latin("{random_sentence}"), "{pig_latin(random_sentence)}")"""
    return test

tests = "" 
for i in range(10000):
    tests+= gen_test() + "\n"
clipboard.copy(str(tests))



